import { useState } from 'react';
import * as S from '../styles/MainPage.style'

function Header() {

  return(
    <S.Header>
        <div>Header</div>
        <S.HeaderMenu>
          <S.Link href="/mainpage" >
            <span>Logs</span>
          </S.Link>
          <S.Link href="/routine" >
            <span>Routine</span>
          </S.Link>
          <S.Link href="/mypage" >
            <span>MyPage</span>
          </S.Link>
          <S.Link>Image</S.Link>
        </S.HeaderMenu>
      </S.Header>
  );
};

export default Header;
